insert  into `tab_telaah`(`id_ts`,`id_pembuat_ts`,`nip_pembuat_ts`,`tanggal_pengajuan`,`perihal`,`persoalan`,`fakta`,`analisis`,`id_kegiatan`,`kepada`,`status_ts`,`id_ttd_spt`,`id_ttd_sppd`,`status_laporan`) values 
('1','613','198605072010011008','2018-04-03','Ujian Assesment dan Interview ke Bandung','<ol>\r\n	<li>Persoalan 1</li>\r\n	<li>Persoalan 2</li>\r\n	<li>Persoalan 3</li>\r\n	<li>Persoalan 4</li>\r\n	<li>Persoalan 5</li>\r\n</ol>\r\n','<ol>\r\n	<li>fakta 1</li>\r\n	<li>fakta 2</li>\r\n	<li>fakta 3</li>\r\n	<li>fakta 4</li>\r\n	<li>fakta 5</li>\r\n	<li>fakta 6</li>\r\n</ol>\r\n','<ol>\r\n	<li>analisis 1</li>\r\n	<li>analisis 2</li>\r\n	<li>analisis 3</li>\r\n	<li>analisis 4</li>\r\n	<li>analisis 5</li>\r\n	<li>analisis 6</li>\r\n</ol>\r\n','3','420','0','4','4','0'),
('2','636','198504082010011013','2018-04-03','Pelaksanaan Assesment Tenaga IT Pemerintah Kota Payakumbuh dan Pengembangan dan Penyusunan konsep helpdesk Dinas Komunikasi dan Informatika terkait implementasi e-gov Pemda Kota Payakumbuh bersama ITB di ITB Bandung.','<ol>\r\n	<li>&nbsp;Peraturan Presiden Nomor 81 Tahun 2010 tentang Grand Design Reformasi Birokrasi 2010 - 2025.</li>\r\n	<li>Peraturan Walikota no 97/2014 tentang Master Plan E-Government Kota Payakumbuh Periode 2014 - 2019.</li>\r\n	<li>MOU Kota Payakumbuh dengan ITB Nomor : 2/MOU/2014 dan Nomor 012/II.A/DN/2014 tentang Kerjasama bidang Pendidikan, Penelitian dan Pengabdian Kepada Masyarakat Kota Payakumbuh.</li>\r\n	<li>Peraturan Walikota Payakumbuh nomor 25 Tahun 2017 tentang Penyelenggaraan e-Government dilingkungan Pemerintah Kota Payakumbuh.</li>\r\n	<li>Perintah lisan Bapak Walikota Payakumbuh melalui Bapak Kepala Dinas Kota Payakumbuh terkait Implementasi Master Plan e-Government Kota Payakumbuh</li>\r\n	<li>DPA Dinas Komunikasi dan Informatika Kota Payakumbuh T.A 2018 Kegiatan Rapat-rapat koordinasi dan konsultasi keluar daerah.</li>\r\n</ol>\r\n','<ol>\r\n	<li>Hasil diskusi serta arahan dari Bapak Walikota Payakumbuh dalam rangka proses percepatan pengembangan dan implementasi e-gov dilingkungan Pemerintah Kota Payakumbuh.</li>\r\n	<li>Bahwa pengembangan e-gov baik aplikasi maupun infrastruktur Pemerintah Daerah harus memanfaatkan tenaga internal pemerintah daerah baik PNS maupun Tenaga Kontrak.</li>\r\n	<li>Pelayanan Dinas Komunikasi dan Informatika terhadap seluruh stakeholder-nya harus ditingkatkan baik terkait permasalahan aplikasi maupun infrastruktur TIK.</li>\r\n	<li>Tindaklanjut MOU Kota Payakumbuh dengan ITB terkait kerjasama untuk Pengambangan SDM TIK.</li>\r\n</ol>\r\n','<ol>\r\n	<li>Perlu dilakukan assessment terhadap tenaga IT Pemerintah Kota Payakumbuh khususnya pada Dinas Komunikasi dan Informatika Kota Payakumbuh baik PNS maupun Tenaga Kontrak.</li>\r\n	<li>Assesment dilaksanakan oleh tim kerja TIK Institut Teknologi Bandung terhadap kemampuan TIk PNS dan Tenaga kontrak Dinas Kominfo untuk bidang pengembangan aplikasi (programmer dan analis sistem) serta bidang pengembangan infrastruktur TIK (Analis Jaringan dan Sys Admin).</li>\r\n	<li>Cara meningkatkan pelayanan Dinas Komunikasi dan Informatika kepada seluruh stakeholder adalah dengan membentuk serta mengembangkan konsep layanan bantuan(helpdesk) untuk menampung dan menyelesaikan laporan permasalahan TIK yang terjadi di seluruh Perangkat Daerah Kota Payakumbuh.</li>\r\n	<li>Pembentukan dan pengembangan konsep layanan bantuan ini membutuhkan analisa dan diskusi bersama tim ahli serta akademisi yang sudah memiliki pengalaman dalam bidangnya.</li>\r\n	<li>Agar Pelaksanaan assessment serta pengembangan konsep layanan bantuan (helpdesk) dapat berjalan dengan maksimal dan dapat diawasi secara full oleh tim kerja TIK ITB maka assessment tersebut akan dilaksanakan di ITB Bandung.</li>\r\n</ol>','3','420','0','4','4','0');
